import './App.css';

//компонента App
function App() {
	return (
		<div>
			<Header />
			<Technologies />
		</div>
	);
}

function Technologies() {
	return (
		<div>
			<ul>
				<li>Tech 1</li>
				<li>Tech 2</li>
				<li>Tech 3</li>
			</ul>
		</div>
	)
}

function Header() {
	return (
		<div>
			<ul>
				<li>qwe</li>
				<li>asd</li>
				<li>asd</li>
			</ul>

		</div>
	);
}

export default App;
